import React from 'react';
import { Card, Col} from 'react-bootstrap';
import { Image } from 'react-bootstrap/Image';

const DeviceItem = ({device}) => {

	return (
		<Col md={3}>
			<Card
				style={{width: 200, cursor: 'pointer'}} 
				border={"light"}
			>
				<Image
					width={200}
					height={200}
					src={device.img}
				/>

			</Card>
		</Col>
	);
};

export default DeviceItem;
